import React, { useState, useEffect } from "react";
import "./App.css";
import SearchPanel from "./Components/SearchPanel";
import { Routes, Route, NavLink } from "react-router-dom";
import { FaCog, FaBook, FaFolderOpen, FaThLarge } from "react-icons/fa";

const MANUALS_LINK =
  "https://tovutigroup1.sharepoint.com/:f:/s/Saharafcsfiles/EmNRXQkGrXZIuDx6V0yw_pkB8zgxSy6M4sFmFhZhCc1g7Q?e=ptE0v2";
const APPVERSIONS_LINK =
  "https://tovutigroup1.sharepoint.com/:f:/s/Saharafcsfiles/Eng2lY8s1TtCqpNe0yhDhi8BkP6t54vGWB9AEejDGD1jqw?e=M6NLBe";

function App() {
  const [darkMode, setDarkMode] = useState(false);

  useEffect(() => {
    const savedMode = localStorage.getItem("darkMode");
    if (savedMode === "true") setDarkMode(true);
  }, []);

  useEffect(() => {
    localStorage.setItem("darkMode", darkMode);
  }, [darkMode]);

  return (
      <div className={`container ${darkMode ? "dark" : ""}`}>
        {/* HEADER */}
        <header className="header">
          <div className="header-title">Dashboard</div>
          <div className="header-search">
            <SearchPanel />
          </div>
          <div className="header-actions">
            <button
              className="darkMode-toggle"
              onClick={() => setDarkMode(!darkMode)}
            >
              {darkMode ? "Light" : "Dark"}
            </button>
          </div>
        </header>

        {/* SIDEBAR */}
        <div className="sidebar">
          <div className="menu-header">MENU</div>
          <div className="menu-top">
            <NavLink
              to="/manuals"
              className={({ isActive }) =>
                `menu-item ${isActive ? "active" : ""}`
              }
              aria-label="Manuals"
            >
              <FaBook className="menu-icon" aria-hidden="true" />
              <span className="menu-text">Manuals</span>
            </NavLink>

            <NavLink
              to="/versions"
              className={({ isActive }) =>
                `menu-item ${isActive ? "active" : ""}`
              }
              aria-label="App Versions"
            >
              <FaFolderOpen className="menu-icon" aria-hidden="true"/>
              <span className="menu-text">App Versions</span>
            </NavLink>

            <NavLink
              to="/section3"
              className={({ isActive }) =>
                `menu-item ${isActive ? "active" : ""}`
              }
              aria-label
            >
              <FaThLarge className="menu-icon" />
              <span className="menu-text">Section 3</span>
            </NavLink>
          </div>

          <div className="menu-bottom">
            <NavLink
              to="/settings"
              className={({ isActive }) =>
                `menu-item ${isActive ? "active" : ""}`
              }
            >
              <FaCog className="menu-icon" />
              <span className="menu-text">Settings</span>
            </NavLink>
          </div>
        </div>

        {/* MAIN CONTENT */}
        <div className="main">
          <div className="content">
            <Routes>
              <Route path="/manuals" element={<Manuals />} />
              <Route path="/versions" element={<AppVersions />} />
              <Route path="/section3" element={<Section3 />} />
              <Route path="/settings" element={<Settings />} />
              {/* Default route */}
              <Route path="*" element={<Manuals />} />
            </Routes>
          </div>
        </div>
      </div>
  );
}

// ðŸ“‚ Manuals section
function Manuals() {
  return (
    <div>
      <h2>Manuals</h2>
      <iframe
        src={MANUALS_LINK}
        width="100%"
        height="600px"
        style={{ border: "none" }}
        title="Manuals Folder"
      ></iframe>
    </div>
  );
}

// ðŸ“‚ App Versions section
function AppVersions() {
  return (
    <div>
      <h2>App Versions</h2>
      <iframe
        src={APPVERSIONS_LINK}
        width="100%"
        height="600px"
        style={{ border: "none" }}
        title="App Versions Folder"
      ></iframe>
    </div>
  );
}

// ðŸ“‚ Section 3 placeholder
function Section3() {
  return <div>Section 3</div>;
}

// ðŸ“‚ Settings placeholder
function Settings() {
  return <div>Settings</div>;
}

export default App;
